import React, { Component } from 'react';

class Home extends Component {
  render(){
    return(
      <div className="jumbotron vh-100 bg-dark">
        <h1>Yu Ohno's Portfolio</h1>
        <h2>Move Emotion</h2>
      </div>
    )
  }
}
export default Home;
